import React from "react";

const Applicants = ({ applicants }) => {
  console.log(applicants);
  return (
    <div>
      {applicants &&
        applicants.map((item) => {
          return <p>{item.Name}</p>;
        })}
    </div>
  );
};

export default Applicants;
